//src/index.js 是js入口文件
//引入ReactDOM
import ReactDOM from 'react-dom/client'

//创建一个jsx
const App = <div>
    <h1>这是一个react项目</h1>
</div>;

//获取一个根容器
const root = ReactDOM.createRoot(document.getElementById('root'))

//将app渲染进根容器
root.render(App)
